    function showSnackBar(alerta, mesj) {
        var x = document.getElementById("snackbar");
        var txt = "<img src=" + alert_image + " width=25  heigth=25> <font style=\"color:#ffc107; font-size: 17px;\">" + alerta + ": </font>" + mesj
        x.innerHTML = txt;
        x.className = "showSnackBar";
        setTimeout(function () {
            x.className = x.className.replace("showSnackBar", "");
        }, 3000);
    }

    function downloadData() {

        var idsElements = document.querySelectorAll('[style="font-size: x-small;"]');
        var id = ""
        idsElements.forEach(function (element) {
            var text = element.textContent || element.innerText;
            id = text.replace("ID ", "");
        });
        GM_xmlhttpRequest({
            method: 'GET',
            url: 'https://www.managerzone.com/ajax.php?p=trainingGraph&sub=getJsonTrainingHistory&sport=' + sport + '&player_id=' + id,
            onload: function (responseDetails) {
                if (responseDetails.responseText === undefined) {
                    responseDetails.responseText = "Not shared"
                }

                if (!responseDetails.responseText.includes('You need to be logged in')) {
                    var playerSkills = Object.values(keys);
                    const playerSkillsMap = new Map();
                    playerSkills.forEach(skill => {
                        playerSkillsMap.set(skill, "No");
                    });
                    const inverseKeys = {};
                    for (const clave in keys) {
                        if (Object.hasOwnProperty.call(keys, clave)) {
                            const valor = keys[clave];
                            inverseKeys[valor] = clave;
                        }
                    }


                    if (responseDetails.responseText == "Not shared") { //No training graph


                        showSnackBar("Warning", "Training graph not shared");


                    } else {


                        const splitedStrings = responseDetails.responseText.split(",");
                        var max_key = GM_getValue("max_key", "NO VALUE")
                        if (max_key === "NO VALUE") {
                            for (let k = 0; k < splitedStrings.length; k++) {
                                if ((max_key === "NO VALUE") && (splitedStrings[k].includes('"name":'))) {
                                    if (notContains(playerSkillsMap, splitedStrings[k])) {
                                        var jsonString = "{" + splitedStrings[k] + "}";
                                        var jsonObject = JSON.parse(jsonString);
                                        var nombre = jsonObject.name;
                                        max_key = nombre;
                                        GM_setValue("max_key", max_key)
                                    }
                                }
                            }

                        }

                        for (let k = 0; k < splitedStrings.length; k++) {
                            if (splitedStrings[k].includes(max_key)) {
                                let temp = splitedStrings[k - 6].trim();
                                let temp1 = splitedStrings[k - 9].trim();
                                let in_index = temp.indexOf("{\"name\":\"");
                                if (!playerSkills.includes(temp.substring(in_index + 9, temp.length - 1))) {
                                    temp = temp1;
                                }
                                in_index = temp.indexOf("{\"name\":\"");
                                if (playerSkills.includes(temp.substring(in_index + 9, temp.length - 1))) {
                                    playerSkillsMap[temp.substring(in_index + 9, temp.length - 1)] = "Yes";
                                }
                            }
                        }


                        const firstCol = document.getElementById('skills').querySelectorAll('table tr:first-child td:first-child');
                        firstCol.forEach(td => {
                            if (playerSkillsMap[keys[td.textContent]] == "Yes") {
                                const nextTd = td.nextElementSibling;
                                const img = nextTd.querySelector('img');

                                const src = img.getAttribute('src');
                                const patron = src.match(/_(\d{1,2})\./)[1]
                                const parsedNumber = parseInt(patron, 10);

                                nextTd.innerHTML = ""
                                for (let i = 0; i < parsedNumber; i++) {
                                    var img1 = document.createElement('img');
                                    img1.src = max_image;
                                    nextTd.appendChild(img1);
                                }
                            }
                        });


                    }

                    GM_xmlhttpRequest({
                        method: 'GET',
                        url: 'https://www.managerzone.com/ajax.php?p=players&sub=scout_report&pid=' + id + '&sport=' + sport,
                        onload: function (responseDetailsScout) {
                            let valores = [];
                            const parser = new DOMParser();
                            const doc = parser.parseFromString(responseDetailsScout.responseText, 'text/html');
                            const aTags = doc.querySelectorAll('span.stars');
                            var index = 0
                            var hp_stars = 0
                            var lp_stars = 0
                            aTags.forEach(tag => {
                                const is = tag.querySelectorAll('i');
                                is.forEach(i => {
                                    if (index <= 3) {

                                        if (i.className == "fa fa-star fa-2x lit") {
                                            document.getElementById("hp_stars").innerHTML += "<img src='" + star_image + "' width='15' heigth='15' />"
                                            hp_stars++;
                                        } else {
                                            document.getElementById("hp_stars").innerHTML += "<img src='" + shadow_star_image + "' width='15' heigth='15' />";
                                        }
                                    }


                                    if (index > 3 && index <= 7) {
                                        if (i.className == "fa fa-star fa-2x lit") {
                                            document.getElementById("lp_stars").innerHTML += "<img src='" + star_image + "' width='15' heigth='15' />"
                                            lp_stars++;
                                        } else {
                                            document.getElementById("lp_stars").innerHTML += "<img src='" + shadow_star_image + "' width='15' heigth='15' />";
                                        }
                                    }

                                    if (index > 7) {
                                        if (i.className == "fa fa-star fa-2x lit") {
                                            document.getElementById("ts_stars").innerHTML += "<img src='" + star_image + "' width='15' heigth='15' />"
                                        } else {
                                            document.getElementById("ts_stars").innerHTML += "<img src='" + shadow_star_image + "' width='15' heigth='15' />";
                                        }
                                    }

                                    index++;
                                });

                            });


                            const spanTags = doc.querySelectorAll('span');
                            index = 0;
                            document.getElementById("hp_skills").innerHTML = ""
                            document.getElementById("lp_skills").innerHTML = ""
                            document.getElementById("ts_skills").innerHTML = ""
                            removeLoaders()
                            spanTags.forEach(etiqueta => {
                                    if (playerSkills.includes(etiqueta.textContent)) {
                                        if (index <= 1) {
                                            document.getElementById("hp_skills").innerHTML += inverseKeys[etiqueta.textContent] + "</br>"
                                            document.getElementById(inverseKeys[etiqueta.textContent]).style.color = colors.get("skc_" + hp_stars)
                                            document.getElementById(inverseKeys[etiqueta.textContent]).style.fontWeight = "bold"
                                        } else {
                                            document.getElementById("lp_skills").innerHTML += inverseKeys[etiqueta.textContent] + "</br>"
                                            document.getElementById(inverseKeys[etiqueta.textContent]).style.color = colors.get("skc_" + lp_stars)

                                        }
                                        index++;
                                    }

                                }
                            );


                            if (document.getElementById("hp_skills").innerHTML == "") {
                                removeLoaders()
                                resetTds()

                            }


                        }


                    });


                } else {

                    showSnackBar("Error", "You're not logged on Managerzone");
                    removeLoaders()
                    resetTds()
                }


            }

        });

    }

    function removeLoaders() {
        var hp_loader = document.getElementById("hp_loader");
        var lp_loader = document.getElementById("lp_loader");
        var ts_loader = document.getElementById("ts_loader");
        if (hp_loader !== null) {
            hp_loader.remove();
        }

        if (lp_loader !== null) {
            lp_loader.remove();
        }

        if (ts_loader !== null) {
            ts_loader.remove();
        }

    }

    function resetTds() {

        document.getElementById("hp_stars").remove()
        document.getElementById("hp_skills").coolspan = 2;
        document.getElementById("hp_skills").innerHTML = "<center><div class='divAlert'>Data not found</div><center>"

        document.getElementById("lp_stars").remove()
        document.getElementById("lp_skills").coolspan = 2;
        document.getElementById("lp_skills").innerHTML = "<center><div class='divAlert'>Data not found</div><center>"
        document.getElementById("ts_stars").remove()
        document.getElementById("ts_skills").coolspan = 2;
        document.getElementById("ts_skills").innerHTML = "<center><div class='divAlert'>Data not found</div><center>"
    }

    function notContains(values, text) {
        var flag = true;
        values.set('<b>', 'No');
        values.forEach(function (valor, clave) {
            if (text.includes(clave)) {
                flag = false;
            }
        });

        return flag;
    }

    function generateExchangeListeners() {
        document.getElementById('textFrom').addEventListener('input', function () {
            calculateListener()
        });

        document.getElementById('currencyFrom').addEventListener('change', function () {
            calculateListener()
        });

        document.getElementById('currencyTo').addEventListener('change', function () {
            calculateListener()
        });

        document.getElementById('resetCurrencyButton').addEventListener('click', function () {
            document.getElementById('textTo').value = ""
            document.getElementById('textFrom').value = ""
        });
    }

    function calculateListener() {
        let fromSelect = document.getElementById('currencyFrom');
        let fromCurrency = fromSelect.value;
        let toSelect = document.getElementById('currencyTo');
        let toCurrency = toSelect.value;
        document.getElementById('textTo').value = convertCurrency(fromCurrency, toCurrency, document.getElementById('textFrom').value)
    }

    function convertCurrency(monedaOrigen, monedaDestino, cantidad) {
        const tasaOrigen = exchangeRates.get(monedaOrigen);
        const tasaDestino = exchangeRates.get(monedaDestino);

        if (!tasaOrigen || !tasaDestino) {
            return null;
        }

        // Conversin: cantidad en moneda de destino
        const cantidadConvertida = (cantidad / tasaDestino) * tasaOrigen;
        return cantidadConvertida;
    }

    function getCookie(nombre) {
        const cookies = document.cookie.split(';');
        for (let i = 0; i < cookies.length; i++) {
            const cookie = cookies[i].trim();
            if (cookie.startsWith(nombre + '=')) {
                return cookie.substring(nombre.length + 1);
            }
        }
        return null;
    }

    function waitToDOMByName(function_to_execute, nameToSearch, miliseconds) {
        let interval = setInterval(function () {
            let elements = document.getElementsByName(nameToSearch);
            if (elements[0]) {
                clearInterval(interval);
                clearTimeout(timeout);
                function_to_execute();
            }
        }, 100);


        let timeout = setTimeout(function () {
            clearInterval(interval);
        }, miliseconds);
    }

    function insertSnackBar(){
        var body = document.body;
         body.insertAdjacentHTML('afterbegin','<center><div id="snackbar"></div></center>')
    }

    function generateModal() {

//MODALS AND LEGEND STUFF
        var newElement = document.createElement("div");
        newElement.id = "legendDiv";
        newElement.className = "legend";
        newElement.innerHTML = '<div style="writing-mode: tb-rl;-webkit-writing-mode: vertical-rl;"><center><img src="' + config_image + '" style="width:25px;height:25px;"/></center></div>';
        var body = document.body;
        body.appendChild(newElement);

        body.insertAdjacentHTML('afterbegin','<div id="myModal_cargando" class="modal_cargando"><div class="modal-content_cargando" id="modal_content_div_cargando"><div id="contenido_modal_cargando" style="background-color:#f2f2f200;"></div></div></div>')
        document.getElementById("contenido_modal_cargando").innerHTML += '<input type="submit" id="resetValues" name="action" class="btn" value="Reset">'
        document.getElementById("modal_content_div_cargando").innerHTML += '<span class="cerrar"><img id="closeButton" src="' + close_image + '" style="width:20px; height;20px"/></span>'
        document.getElementById("myModal_cargando").style.display = "none"


//Event listener to open and close modals
        document.getElementById("legendDiv").addEventListener('click', function () {

            if (document.getElementById("myModal_cargando").style.display == "none") {
                document.getElementById("myModal_cargando").style.display = "flex";
                document.getElementById("modal_content_div_cargando").style.backgroundColor = "#f2f2f2";

            } else {
                document.getElementById("myModal_cargando").style.display = "none";
            }

        });


        document.getElementById("closeButton").addEventListener('click', function () {
            document.getElementById("myModal_cargando").style.display = "none";
        });

        //Event listener to reset values
        document.getElementById("resetValues").addEventListener('click', function () {
            GM_deleteValue("playerSkillsMapsoccer")
            GM_deleteValue("playerSkillsMaphockey")
            GM_deleteValue("keyshockey")
            GM_deleteValue("keyssoccer")
            GM_deleteValue("max_key")
            location.reload();

        });

    }

